import LINK from 'next/link'


const Navbar = () => (
    <div>
    <ul>
        <li><LINK href="/"><a>Index</a></LINK></li>
        <li><LINK href="/about"><a>About</a></LINK></li>
    </ul>

<style jsx>{`
    ul  {
        background : yellow;
    }
`}</style>
</div>
);

export default Navbar
